template <typename ... _AttributeExtensions>
MediaPlayerProxy<_AttributeExtensions...>::MediaPlayerProxy(std::shared_ptr<CommonAPI::Proxy> delegate):
        _AttributeExtensions(*(std::dynamic_pointer_cast<MediaPlayerProxyBase>(delegate)))...,
        delegate_(std::dynamic_pointer_cast<MediaPlayerProxyBase>(delegate)) {
}

template <typename ... _AttributeExtensions>
MediaPlayerProxy<_AttributeExtensions...>::~MediaPlayerProxy() {
}

/**
 * description: Method to initiate the playback of all items of a specific object type in the
 *   device
 */
template <typename ... _AttributeExtensions>
void MediaPlayerProxy<_AttributeExtensions...>::playAll(const uint8_t &_slotId, const ::v3::com::harman::mmpres::MMPresTypes::eMetadataType &_objectType, CommonAPI::CallStatus &_internalCallStatus, ::v3::com::harman::mmpres::MMPresTypes::eCallResult &_result, const CommonAPI::CallInfo *_info) {
    if (!_objectType.validate()) {
        _internalCallStatus = CommonAPI::CallStatus::INVALID_VALUE;
        return;
    }
    delegate_->playAll(_slotId, _objectType, _internalCallStatus, _result, _info);
}

template <typename ... _AttributeExtensions>
std::future<CommonAPI::CallStatus> MediaPlayerProxy<_AttributeExtensions...>::playAllAsync(const uint8_t &_slotId, const ::v3::com::harman::mmpres::MMPresTypes::eMetadataType &_objectType, PlayAllAsyncCallback _callback, const CommonAPI::CallInfo *_info) {
    if (!_objectType.validate()) {
        ::v3::com::harman::mmpres::MMPresTypes::eCallResult result = ::v3::com::harman::mmpres::MMPresTypes::eCallResult::CALLRESULT_OK;
        _callback(CommonAPI::CallStatus::INVALID_VALUE, result);
        std::promise<CommonAPI::CallStatus> promise;
        promise.set_value(CommonAPI::CallStatus::INVALID_VALUE);
        return promise.get_future();
    }
    return delegate_->playAllAsync(_slotId, _objectType, _callback, _info);
}
